import * as react from 'react';
import {
  Stack,
  Grid,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  Button,
  Paper,
  Box,
  Divider,
  Card,
  CardContent,
  TablePagination,
} from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import ErrorIcon from '@mui/icons-material/Error';
import ListAltIcon from '@mui/icons-material/ListAlt';
import { mockViolations } from '../../../mock/violations';
import { useState } from 'react';
import { useTheme } from '@mui/material';

export default function Alerts(): React.ReactElement {
  const theme = useTheme();
  const openCount = mockViolations.filter((i) => i.status === 'open').length;
  const resolvedCount = mockViolations.filter((i) => i.status === 'resolved').length;
  const totalCount = mockViolations.length;
  const stats = [
    { label: 'Open', value: openCount, icon: <ErrorIcon color="error" /> },
    { label: 'Resolved', value: resolvedCount, icon: <CheckCircleIcon color="success" /> },
    { label: 'Total', value: totalCount, icon: <ListAltIcon color="primary" /> },
  ];
  type violationData = {
    id: number;
    type: string;
    status: string;
    handler: null | string;
    timestamp: string;
    imageUrl: string;
  };
  const [selected, setSelected] = useState<violationData | null>(null);
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const handleChangePage = (_: unknown, newPage: number) => setPage(newPage);
  const handleChangeRowsPerPage = (event: React.ChangeEvent<HTMLInputElement>) => {
    const value = parseInt(event.target.value, 10);
    setRowsPerPage(value);
    setPage(0);
  };
  const visibleRows = (rowsPerPage: number) => {}
  const handleRowClick = (row: violationData) => {
    setSelected(row);
  };

  return (
    <Grid
      container
      direction="column"
      spacing={2}
      sx={{ bgcolor: 'background.paper', minHeight: 0, flex: 1 }}
    >
      <Grid size={{ xs: 12 }}>
        <Typography variant="h6">Alerts</Typography>
      </Grid>

      <Grid size={{ xs: 12 }} sx={{ color: 'primary.main' }}>
        <Grid container spacing={2}>
          {stats.map((s) => (
            <Grid size={{ xs: 12, sm: 4 }} key={s.label}>
              <Card sx={{ p: 1 }}>
                <CardContent>
                  <Stack direction="row" alignItems="center" spacing={2}>
                    <Typography variant="subtitle1">{s.label}</Typography>
                    <Typography variant="h5" color="primary" fontWeight="bold">
                      {s.value}
                    </Typography>
                    {s.icon}
                  </Stack>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Grid>

      <Grid size={{ xs: 12 }} sx={{ flex: 1, minHeight: 0 }}>
        <Grid container sx={{ height: '100%', minHeight: 0 }}>
          <Grid size={{ xs: 12, sm: 3 }}>
            <Paper sx={{ height: '100%' }}>
              <TableContainer>
                <Table stickyHeader>
                  <TableHead>
                    <TableRow>
                      <TableCell>Id</TableCell>
                      <TableCell>Type</TableCell>
                      <TableCell>Time</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {mockViolations
                      .filter((i) => i.status === 'open')
                      .map((row) => (
                        <TableRow
                          key={row.id}
                          hover
                          sx={{
                            cursor: 'pointer',
                            bgcolor:
                              selected?.id === row.id ? theme.palette.action.selected : undefined,
                          }}
                          onClick={() => handleRowClick(row)}
                        >
                          <TableCell>{row.id}</TableCell>
                          <TableCell>{row.type}</TableCell>
                          <TableCell>{row.timestamp}</TableCell>
                        </TableRow>
                      ))}
                  </TableBody>
                </Table>
              </TableContainer>
              <TablePagination
                component="div"
                count={mockViolations.filter((i) => i.status === 'open').length}
                page={page}
                onPageChange={handleChangePage}
                rowsPerPage={10}
                onRowsPerPageChange={handleChangeRowsPerPage}
                rowsPerPageOptions={[10, 25]}
              />
            </Paper>
          </Grid>
          <Grid size={{ xs: 12, sm: 9 }} sx={{ minHeight: 0 }}>
            <Stack sx={{ height: '100%', minHeight: 0 }}>
              <Stack sx={{ flex: 8, borderBottom: '1px solid', borderColor: 'grey' }}>
                ScreenShot
              </Stack>
              <Stack sx={{ flex: 4 }}>Table</Stack>
            </Stack>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}
